import React, { Component } from "react";
import "./css/Cell.css";


class Cell extends Component{
    render(){
        const data=this.props.parm;
        console.log(data);
        return (
           <div className={data.kind}>{data.id}
           </div>
        );
    }
}
export default Cell;
